import React from 'react'

class MobileApp extends React.Component {
  render() {
    const style = {
        "max-width": "168px"
      }
    return (
      <React.Fragment>
        <header>
          <h1 id="mobileTitle"> Sawasdee <br/>Thai Cuisine </h1>
          <iframe style={style}src="https://sawasdeesoquel.com/Soquel_LunchMenu.pdf"></iframe>
        </header>
      </React.Fragment>
    )
  }
}
export default MobileApp

